import React, { useState } from 'react';
import axios from 'axios';

const statesAndCities = {
  NC: ["Winston", "Charlotte"],
  CA: ["LosAngeles", "SanFrancisco"],
  // Add other states and cities here
};

function App() {
  const [selectedState, setSelectedState] = useState('');
  const [selectedCity, setSelectedCity] = useState('');
  const [monthsAhead, setMonthsAhead] = useState(1);
  const [analysisField, setAnalysisField] = useState('adj_value');
  const [results, setResults] = useState(null);
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      setError('');
      const response = await axios.post('http://localhost:8000/api/predict/', {
        state: selectedState,
        city: selectedCity,
        months_ahead: monthsAhead,
        analysis_field: analysisField,
      });
      setResults(response.data);
    } catch (error) {
      console.error("There was an error predicting the prices!", error);
      setError('There was an error predicting the prices.');
    }
  };

  return (
    <div className="App">
      <h1>Housing Price Prediction</h1>
      <form onSubmit={handleSubmit}>
        <label>
          State:
          <select value={selectedState} onChange={(e) => setSelectedState(e.target.value)}>
            <option value="">Select a state</option>
            {Object.keys(statesAndCities).map((state) => (
              <option key={state} value={state}>{state}</option>
            ))}
          </select>
        </label>
        <br />
        <label>
          City:
          <select value={selectedCity} onChange={(e) => setSelectedCity(e.target.value)} disabled={!selectedState}>
            <option value="">Select a city</option>
            {selectedState && statesAndCities[selectedState].map((city) => (
              <option key={city} value={city}>{city}</option>
            ))}
          </select>
        </label>
        <br />
        <label>
          Months Ahead:
          <input type="number" value={monthsAhead} onChange={(e) => setMonthsAhead(e.target.value)} />
        </label>
        <br />
        <label>
          Analysis Field:
          <select value={analysisField} onChange={(e) => setAnalysisField(e.target.value)}>
            <option value="adj_value">Adjusted Value</option>
            <option value="adj_price">Adjusted Price</option>
            <option value="price">Price</option>
          </select>
        </label>
        <br />
        <button type="submit">Predict</button>
      </form>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {results && (
        <div>
          <h2>Prediction Results</h2>
          <p>Predicted {analysisField}: {parseFloat(results.future_prices[results.future_prices.length - 1]).toFixed(2)}</p>
          <p>Model Accuracy: {parseFloat(results.accuracy).toFixed(2)}</p>
          <h2>Descriptive Analysis</h2>
          <img src={`data:image/png;base64,${results.analysis.plot}`} alt="Analysis Plot" />
          <img src={`data:image/png;base64,${results.over_time.plot1}`} alt="Over Time Plot" />
          <h3>Descriptive Statistics</h3>
          <pre>{JSON.stringify(results.analysis.description, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default App;
